INSERT INTO `booksinfo` VALUES ('2799', 'C0400024', null, '22', '0', '营养对经', null, '567', '英  帕特里克。霍乐福德', '范志红', '0', '2013-08-01', '2013-12-30', null, '49.80', '0', '0', '无期限', null, null, null, '0');
INSERT INTO `booksinfo` VALUES ('2800', 'A0300638', null, '4', '0', '红拂夜奔', '红拂夜奔', '22', '王小波', null, '0', '2013-06-01', '2015-05-12', null, '39.00', '432', '0', '无期限', null, '这本书它以现代人的眼光去观照历史，又以历史文化原型来建构现代小说的结构。历史的重建和复归在于人类有共同的心理品质，共同的生存状态和共同的生存困境。', null, '0');
INSERT INTO `booksinfo` VALUES ('2801', 'G2200008', null, '83', '0', '新金融秩序', 'THE NEW FINANCIAL ORDER', '80', '罗伯特.席勒', '束宇', '0', '2014-01-01', '2015-05-12', null, '59.00', '284', '0', '无期限', null, '重点阐述了如何将风险管理的手段运用于解决日常生活中的重大问题，展示了一种通过信息技术手段紧密结合在一起的风险管理文化，与现有的社会经济制度相呼应，二者共同促进财富的增长。', null, '0');
INSERT INTO `booksinfo` VALUES ('2802', 'A0300639', null, '4', '0', '檀香刑', '檀香刑', '52', '莫言', null, '0', '2012-11-01', '2015-05-12', null, '38.00', '516', '0', '无期限', null, '在这部神品妙构的小说中，莫言以1900年德国人在山东修建胶济铁路，袁世凯镇压山东义和团运动，八国联军攻陷北京，慈禧仓皇出逃为历史背景，用摇曳多姿的笔触，大悲大喜的激动，高瞻深睿的思想，活灵活现地讲述了发生在”高密东北乡“的一场可歌可泣的农民运动，一桩骇人听闻的酷刑，一段惊心动魄的爱情。', null, '0');
INSERT INTO `booksinfo` VALUES ('2803', 'C0900028', null, '29', '0', '稀缺：我们是如何陷入贫穷与忙碌的', null, '127', '塞德希尔.穆来纳森     埃尔德.沙菲尔', '魏薇     龙志勇', '0', '2014-11-01', '2015-05-12', null, '56.90', '258', '0', '无期限', null, '旨在揭示稀缺心态的各种复杂成因，并提出以”余闲“牵制稀缺的应对之法。所以，只有对”带宽“进行合理的规划和管理，我们才有可能从稀缺走向富足。', null, '0');
INSERT INTO `booksinfo` VALUES ('2804', 'D0900029', null, '78', '0', '原本大学微言（上）', '原本大学微言（上）', '131', '南怀瑾', null, '0', '2014-07-01', '2015-05-12', null, '34.50', '308', '0', '无期限', null, '这本书自然是要讲《大学》的，结合南师的演讲和手记，旁征博引，纵横开阖，学了《大学》，也了解了很多历史故事和禅宗学案，真算得上是学习《纲鉴易知录》的易知录了。', null, '0');
INSERT INTO `booksinfo` VALUES ('2805', 'D0900030', null, '78', '0', '原本大学微言（下）', '原本大学微言（下）', '131', '南怀瑾', null, '0', '2014-07-01', '2015-05-12', null, '34.50', '320', '0', '无期限', null, '这本书自然是要讲《大学》的，结合南师的演讲和手记，旁征博引，纵横开阖，学了《大学》，也了解了很多历史故事和禅宗学案，真算得上是学习《纲鉴易知录》的易知录了。', null, '0');
INSERT INTO `booksinfo` VALUES ('2806', 'A0300640', null, '4', '0', '不能承受的生命之轻', null, '23', '米兰.昆德拉', '许钧', '0', '2014-08-01', '2015-05-12', null, '46.00', '427', '0', '无期限', null, '小说依托六十年代的捷克斯洛伐克的政治历史背景，围绕着托马斯，特蕾莎，萨比娜和弗兰茨等人物，以托马斯和特蕾莎的爱情为主线展开故事。', null, '0');
INSERT INTO `booksinfo` VALUES ('2807', 'A0300641', null, '4', '0', '无影灯', null, '565', '渡边淳一', '桑凤平    张宓    知非', '0', '2014-04-01', '2015-05-13', null, '42.80', '466', '0', '无期限', null, '一个医生的故事，一个讲述生命与尊严，欲念与悲悯交互纠结的故事。', null, '0');
INSERT INTO `booksinfo` VALUES ('2808', 'A0300642', null, '4', '0', '北京城杂忆', null, '118', '萧乾', null, '0', '2012-10-01', '2015-05-13', null, '25.00', '251', '0', '无期限', null, '为劫后余生的萧乾先生站在今和昨，新和旧的北京之间，以抚今追昔的心情，用独特的京白抒写过往的人，事，城。幽默，俏皮，利落的文字中糅进了伤感的留恋和深刻的反思。', null, '0');
INSERT INTO `booksinfo` VALUES ('2809', 'A0300644', null, '4', '0', '白鹿原', null, '61', '陈忠实', null, '0', '1993-06-01', '2015-05-13', null, '39.00', '697', '0', '无期限', null, '这是一部渭河平原五十年变迁的雄奇史诗，一轴中国农村斑斓多彩，触目惊心的长幅画卷。主人公六娶六丧，神秘的序曲预示着不祥。一个家族两代子孙，为争夺白鹿原的统治代代争斗不已，上演了一幕幕惊心动魄的活剧：巧取风水地，恶施美人计，孝子为匪，亲翁杀媳，兄弟相煎，情人反目....大革命，日寇入侵，三年内战，白鹿原翻云覆雨，王旗变幻，家仇国恨交错缠结，冤冤相报代代不已....古老的土地在新生的阵痛中颤粟。厚重深邃的思想内容，复杂多变的人物性格，跌宕曲折的故事情节，绚丽多彩的风土人情，形成作品鲜明的艺术特色和令人震撼的真实感。', null, '0');
INSERT INTO `booksinfo` VALUES ('2810', 'D0200015', null, '34', '0', '民主的细节', null, '306', '刘瑜', null, '0', '2009-06-01', '2015-06-14', null, '25.00', '293', '0', '无期限', null, '这本书是作者过去几年给一些期刊报纸写的专栏文章集结，其中主要是给《南方人物周刊》的文章。全书中以讲故事的形式，把“美国的民主”这样一个概念性的东西拆解成点点滴滴的事件，政策和人物去描述。', null, '0');
INSERT INTO `booksinfo` VALUES ('2811', 'G0500005', null, '44', '0', '变革中国', '变革中国 市场经济的中国之路', '80', 'Ronald H.Coase', '王宁', '0', '2013-01-01', '2015-06-30', null, '58.00', '295', '0', '无期限', null, '这是所有关于经济变革以及中国的研究文献中极为厚重的一笔。在我所知道的关于经济变革和发展的文献中，无一能对一个在磕磕碰碰中演变的社会进行故此详尽的研究，尤其是对像中国这样经历了漫漫征程而前路依然漫长的社会。', null, '0');
