INSERT INTO `booksinfo` VALUES ('2839', 'A0100054', null, '2', '0', '乡关何处', null, '242', '白睿文', '连城', '0', '2010-01-01', '2015-05-13', null, '22.00', '185', '0', '无期限', null, '本书的核心是对每部电影的个连串细读；透过这种细读，白睿文梳理出它们的核心叙事主题，强调了贾樟柯对剪辑，电影语言和场面调度的运用。他特别关注互文性以及这些破坏与变化，停滞与运动，政治与流行文化的冲突协商，寻找故乡等核心主题在贾樟柯作品中的地位。', null, '0');
INSERT INTO `booksinfo` VALUES ('2840', 'G2200009', null, '83', '0', '外汇检查手册', null, '10', '孙工声', null, '0', '2010-12-01', '2015-05-13', null, '30.00', '286', '0', '无期限', null, '本书是外汇局江苏省分局历年来开展专项调查，案件查办的方法，理念和经验的总结，记录了江苏省外汇检查战线上的广大同志们在实践中不断探索前进的足迹。', null, '0');
INSERT INTO `booksinfo` VALUES ('2841', 'D0500040', null, '37', '0', '论法的精神(上）', null, '190', '孟德斯鸠', '许明龙', '0', '2012-05-01', '2015-05-13', null, '44.00', '519', '0', '无期限', null, '公认的十八世纪最伟大的，最深远地影响了历史的作品是哪几部？人们很轻易地说出亚当.史密斯的《国富论》，卢梭的《社会契约论》和孟德斯鸠的《论法的精神》。', null, '0');
