INSERT INTO `booksinfo` VALUES ('2877', 'A0200148', null, '3', '0', '看见', null, '242', '柴静', null, '0', '2013-01-01', '2015-06-03', null, '39.80', '405', '0', '无期限', null, '《看见》是知名记者和主持人柴静讲述央视十年历程的自传性作品，既是柴静个人的成长告白书，某种程度上亦可视作中国社会十年变迁的备忘录。', null, '0');
INSERT INTO `booksinfo` VALUES ('2878', 'A0300645', null, '4', '0', '侯卫东官场笔记', null, '486', '小桥老树', null, '0', '2011-05-01', '2015-06-03', null, '29.80', '317', '0', '无期限', null, '侯卫东的这本笔记，将带您深深潜入中国公务员系统庞大，复杂而精彩的内部世界，从村，镇，县，市一直到省，随着主人公侯卫东的10年升迁之路，逐层剥开茫茫官场的现状与秘密。', null, '0');
INSERT INTO `booksinfo` VALUES ('2879', 'A0600180', null, '8', '0', '你永远都无法叫醒一个装睡的人', '你永远都无法叫醒一个装睡的人', '124', '周濂', null, '0', '2012-04-01', '2015-10-15', null, '32.00', '301', '0', '无期限', null, '在一个乌烟瘴气的喧嚣迷茫时代，在一个颠倒是非的时代里生活，个体性的痛楚可想而知，除非你放弃自身的价值标准，与这个肮脏的时代握手言和，或者闭上眼睛装睡。可是即使是在外部环境非常糟糕的情况下，一个人依然可以选择过一种合乎德性的生活。', null, '0');
INSERT INTO `booksinfo` VALUES ('2880', 'D0900032', null, '78', '0', '曾国藩的正面与侧面', '曾国藩的正面与侧面', '16', '张宏杰', null, '0', '2014-05-01', '2015-10-15', null, '39.80', '296', '0', '无期限', null, '讲述了曾国藩跌宕起伏的一生，同时也揭露了曾国藩诸多不为人知的方面。真实的曾国藩，远比那个“永远正确”的“圣人”可爱。曾国藩不仅仅是一个政治家或军事家，思想家，他首先是一个人~~一个生活在尘世中，挣扎，纠结，冲突和矛盾的人，一个既有灵魂又有体温的人。', null, '0');
INSERT INTO `booksinfo` VALUES ('2881', 'A0600181', null, '8', '0', '送你一颗子弹', null, '306', '刘瑜', null, '0', '2010-01-01', '2015-12-21', null, '25.00', '339', '0', '无期限', null, '在这本书里，被”审视“的东西杂七杂八，有街上的疯老头，有同宿舍的室友，有爱情，电影和书，大到制度，小到老鼠。', null, '0');
INSERT INTO `booksinfo` VALUES ('2882', 'C0700014', null, '27', '0', '荒野求生手册', 'Born survivor', '36', '贝尔.格里尔斯', '李璞良', '0', '2014-10-01', '2015-12-21', null, '49.80', '270', '0', '无期限', null, '作者介绍了在各种恶劣的生态环境下，包括山区，丛林，沙漠，大海和零度以下的区域里的求生之道，引领读者踏上一段段奇妙的冒险旅程。', null, '0');
