INSERT INTO `booksinfo` VALUES ('2920', 'G0100055', null, '40', '0', '反脆弱-从不确定性中获益', 'Antifragile', '80', '纳西姆.尼古拉斯.塔勒布', '雨珂', '0', '2014-01-01', '2015-05-12', null, '68.00', '370', '0', '无期限', null, '塔勒布告诉我们在不确定的世界中的生存法则，他找到并定义了”反脆弱“类事物：每一个事物都会从波动中得到利益或蒙受损失，脆弱性是指因为波动和不确定而承受损失，反脆弱性则是指让自己避免这些损失，甚至从混乱和不确定中获利。', null, '0');
INSERT INTO `booksinfo` VALUES ('2921', 'A0600175', null, '8', '0', '人间草木', '人间草木', '100', '汪曾祺', null, '0', '2014-04-01', '2015-05-12', null, '34.80', '229', '0', '无期限', null, '优秀的散文集', null, '0');
INSERT INTO `booksinfo` VALUES ('2922', 'D0100054', null, '33', '0', '公正', 'JUSTICE', '80', '迈克尔.桑德尔', '朱慧玲', '0', '2012-12-01', '2015-05-12', null, '59.00', '334', '0', '无期限', null, '桑德尔在书中告诉我们，这些貌似互不相关的争议，都可以归结为对公正持有不同的观念。桑德尔将这些观念归纳成三种：追求福利最大化的功利主义，尊重个体权利的自由至上主义，以及提倡公民德性和共同善的政治观。', null, '0');
INSERT INTO `booksinfo` VALUES ('2923', 'E0100020', null, '23', '0', 'AutoCAD2014中文版基础教程', 'AutoCAD2014', '94', '徐江华，王莹莹，俞大丽，张敏', null, '0', '2014-01-01', '2015-05-12', null, '28.00', '279', '0', '无期限', null, '本书以AutoCAD2014为基础，针对建筑设计，机械设计，系统介绍了AutoCAD2014的基础知识，并结合基本绘图知识讲解了如何使用AutoCAD绘制建筑施工图。', null, '0');
INSERT INTO `booksinfo` VALUES ('2924', 'A0100052', null, '2', '0', '第二性（1）', null, '23', '西蒙娜.德.波伏瓦', '郑克鲁', '0', '2011-09-01', '2015-05-12', null, '36.00', '354', '0', '无期限', null, '人类求索中的女性哲学。向所有读者，无论是男性，还是女性，揭示了当代妇女面临的问题：生命的自由，堕胎，卖淫和两性的平等。', null, '0');
INSERT INTO `booksinfo` VALUES ('2925', 'A0100053', null, '2', '0', '第二性（2）', null, '23', '西蒙娜.德.波伏瓦', '郑克鲁', '0', '2011-09-01', '2015-05-12', null, '49.00', '614', '0', '无期限', null, '人类求索中的女性哲学。向所有读者，无论是男性，还是女性，揭示了当代妇女面临的问题：生命的自由，堕胎，卖淫和两性的平等。', null, '0');
INSERT INTO `booksinfo` VALUES ('2926', 'A0700022', null, '9', '0', '给孩子的诗', null, '80', '北岛', null, '0', '2014-07-01', '2015-05-12', null, '30.00', '171', '0', '无期限', null, '57位不同国别的诗人，101首不同风格的新诗，携带着思想，文学，文明的火种，交给孩子，照亮下一代的阅读空间。', null, '0');
INSERT INTO `booksinfo` VALUES ('2927', 'A0600177', null, '8', '0', '上帝是个不合格的药剂师', null, '306', '韩松落', null, '0', '2014-06-01', '2015-05-13', null, '29.80', '217', '0', '无期限', null, '本书是专栏作家韩松落的娱乐随笔，时间跨度为2008年到2012年，对”艳照门“，莫少聪吸毒事件，贾宏声去世，王菲复出，王晶北上，李宇春崛起等重大娱乐事件，进行了描述和点评。', null, '0');
INSERT INTO `booksinfo` VALUES ('2928', 'G1900010', null, '70', '0', '经营十二条', null, '80', '稻盛和夫', '曹岫云', '0', '2011-06-01', '2015-05-13', null, '35.00', '172', '0', '无期限', null, '缔造两家世界五百强企业，2010成功拯救日航的全球知名企业家稻盛和夫先生，全力奉献提高经营者思想和精神，成功提升事业的经营之道。', null, '0');
INSERT INTO `booksinfo` VALUES ('2929', 'D0200014', null, '34', '0', '资本主义，社会主义和民主', 'CAPITALISM SOCIALISM AND DEMOCRACY', '3', '约瑟夫.熊彼特', '杨中秋', '0', '2013-07-01', '2015-05-13', null, '49.80', '391', '0', '无期限', null, '书中探讨了马克思主义学说，资本主义未来的发展，以及社会主义与民主等相关问题。', null, '0');
INSERT INTO `booksinfo` VALUES ('2930', 'A1300020', null, '66', '0', '放学后', '', '18', '东野圭吾', '赵峻', '0', '2010-01-01', '2015-06-14', null, '28.00', '227', '0', '无期限', null, null, null, '0');
INSERT INTO `booksinfo` VALUES ('2931', 'A0300646', null, '4', '0', '失乐园', null, '565', '渡边淳一', '竺家荣', '0', '2014-06-01', '2015-10-15', null, '39.80', '379', '0', '无期限', null, '一场悲剧性的婚外恋，从一个侧面反映了都市生活和当代日本人的种种心态。', null, '0');
INSERT INTO `booksinfo` VALUES ('2932', 'C1200029', null, '32', '0', '权利48法则', null, '61', '罗伯特.格林，朱斯特.艾尔弗斯', '金马，卢安安，张小玲', '0', '2013-01-01', '2015-05-12', null, '49.00', '435', '0', '无期限', null, '“权力“是一个”泛权力“的概念，并不专指政治权谋。更多的是”控制力“和”操纵力“的代名词。', null, '0');
INSERT INTO `booksinfo` VALUES ('2933', 'A0600176', null, '8', '0', '皮囊', null, '100', '蔡崇达', null, '0', '2014-12-01', '2015-05-13', null, '39.80', '264', '0', '无期限', null, '讲述了一系列在骨肉间故事。一个福建渔业小镇上的风土人情和时代变迁，在这些温情而又残酷的故事中一一体现。', null, '0');
INSERT INTO `booksinfo` VALUES ('2934', 'A0300643', null, '4', '0', '妻妾成群', null, '32', '苏童', null, '0', '2013-08-01', '2015-05-13', null, '20.00', '192', '0', '无期限', null, '《妻妾成群》借旧中国特有的封建家庭模式作小说的框架，一个男人娶了四个女人做太太。但作者关心的不是一个男人如何在四个女人中周旋，如何控制她们，而是关心四个女人怎会把她们一齐拴在一个男人的脖子上，并且像一棵频临枯萎的藤蔓在稀薄的空气中相互绞杀而争得那一点点空气。', null, '0');
INSERT INTO `booksinfo` VALUES ('2935', 'E0100021', null, '23', '0', 'Excel商业图表的三招两式', null, '3', '张晓明', null, '0', '2013-10-01', '2015-06-03', null, '59.00', '237', '0', '无期限', null, '本书定位很明确，内容有趣易懂。本书不同于大多数“伪操作手册”，更不以亦步亦趋的克隆模仿为目标，而是通过对Excel画图机制的剖析，意图让读者抛弃一切手册，达到闲庭信步，信手拈来的天人合一境界。', null, '0');
INSERT INTO `booksinfo` VALUES ('2936', 'A0600006', null, '8', '0', '寻路中国', 'Country Driving', '457', 'PETER HESSLER', '李雪顺', '0', '2011-01-01', '2015-06-30', null, '33.00', '426', '0', '无期限', null, '探讨经济，追踪发展的源头，探究个人对变革的应对。研究中国的核心议题，但并不通过解读著名的政治或文化人物来实现这个目的。', null, '0');
INSERT INTO `booksinfo` VALUES ('2937', 'D0100055', null, '33', '0', '李光耀论中国与世界', 'Lee Kuan Yew:The Grand Master\'s Insights on China,the United States,and the World', '80', '李光耀', '蒋宗强', '0', '2013-10-01', '2015-07-16', null, '39.00', '216', '0', '无期限', null, '对于中国的未来，李光耀认为“中国希望和美国平等共享这个世纪”。他肯定了美国作为世界唯一超级大国的地位，但对美国政治体系的反复无常表示失望。他对如何与中国打交道提出了自己的建议，继而谈论了印度的未来，伊斯兰恐怖主义，经济增长，地缘政治和全球化以及民主等话题。李光耀直言不讳，以直白的语言表达了对多元文化，福利国家，教育以及自由市场的看法。', null, '0');
INSERT INTO `booksinfo` VALUES ('2938', 'D0700002', null, '76', '0', '失控', 'OUT OF CONTROL', '375', '凯文.凯利', '东西文库', '0', '2011-03-01', '2015-12-21', null, '98.00', '730', '0', '无期限', null, '这本书所记述的，是他对当时科技，社会和经济最前沿的一次漫游，以及借此所窥得的未来图景。', null, '0');
INSERT INTO `booksinfo` VALUES ('2939', 'A1800018', null, '74', '0', '乖，摸摸头', null, '75', '大冰', null, '0', '2014-10-01', '2015-12-15', null, '36.00', '335', '0', '无期限', null, '记录了他在拉萨，丽江与大理路上遇到12个人，以及关于他们的爱与温暖的故事', null, '0');
INSERT INTO `booksinfo` VALUES ('2940', 'D0900033', null, '78', '0', '唐朝穿越指南', null, '565', '森林鹿', null, '0', '2012-12-01', '2015-12-21', null, '35.00', '295', '0', '无期限', null, '野生历史爱好者说唐朝第一本体验式历史读物。唐朝上至皇宫贵族，下至市井小民，吃穿住行，文娱生活全景再现。', null, '0');
INSERT INTO `booksinfo` VALUES ('2941', 'A1300021', null, '66', '0', '白夜行', null, '18', '东野圭吾', '刘姿君', '0', '2008-09-01', '2015-12-21', null, '39.50', '538', '0', '无期限', null, '”只希望能手牵手在太阳下散步“，这个象征故事内核的绝望念想，有如一个美丽的幌子，随着无数凌乱，压抑，悲凉的故事片段像记录片一样一一还原：没有痴痴相思，没有海枯石烂，只剩下一个冰冷绝望的诡计，最后一丝温情也被完全抛弃。', null, '0');
INSERT INTO `booksinfo` VALUES ('2942', 'D0400050', null, '36', '0', '伟大的博弈', 'The Great Game', '80', '约翰.S.戈登', '祁斌', '0', '2011-01-01', '2015-12-21', null, '58.00', '400', '0', '无期限', null, '这是一本关于华尔街历史的书，也是一本关于美国金融史和经济史的书。', null, '0');
