-- ----------------------------
-- Table structure for booksborrowinfo
-- ----------------------------
DROP TABLE IF EXISTS `booksborrowinfo`;
CREATE TABLE `booksborrowinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_id` varchar(11) NOT NULL COMMENT '借书人工号',
  `booksInfo_id` varchar(11) NOT NULL COMMENT '图书编号',
  `lendDate` varchar(10) NOT NULL COMMENT '借出时间',
  `agreeReturnDate` varchar(10) NOT NULL COMMENT '约定归还时间',
  `realReturnDate` varchar(10) DEFAULT NULL COMMENT '实际归还时间',
  `reLendDate` varchar(10) DEFAULT NULL COMMENT '续借时间',
  `deposit` decimal(10,2) DEFAULT '0.00' COMMENT '押金',
  `status` tinyint(2) DEFAULT '0' COMMENT '状态  0：未还  1：已还',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT='图书借还登记';

