-- Table structure for booksclass
-- ----------------------------
DROP TABLE IF EXISTS `booksclass`;
CREATE TABLE `booksclass` (
  `id` int(11) NOT NULL,
  `className` varchar(100) DEFAULT NULL COMMENT '类目名称',
  `classNum` varchar(100) DEFAULT NULL COMMENT '分类号',
  `parent_id` varchar(11) DEFAULT NULL COMMENT '父类',
  `borrowDays` varchar(20) DEFAULT NULL COMMENT '借书期限  无期限  3天  7天  半个月  一个月  三个月  半年  一年',
  `booksNum` int(5) DEFAULT '0' COMMENT '已有图书本书（只记录到2级类目下的本书）',
  `subClassNum` int(5) DEFAULT '0' COMMENT '包含子类目的数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of booksclass
-- ----------------------------

