-- Table structure for booksinfo
-- ----------------------------
DROP TABLE IF EXISTS `booksinfo`;
CREATE TABLE `booksinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `booksSerialNo` varchar(100) DEFAULT NULL COMMENT '图书号',
  `volumeNumber` varchar(100) DEFAULT NULL COMMENT '卷册号',
  `booksClass_id` varchar(11) NOT NULL COMMENT '图书分类号',
  `isRecommend` tinyint(2) DEFAULT '0' COMMENT '是否推荐    0：否  1：是',
  `booksNameCN` varchar(200) NOT NULL COMMENT '中文名称',
  `booksNameReal` varchar(200) DEFAULT NULL COMMENT '原文名称',
  `booksPublish_id` varchar(11) NOT NULL COMMENT '出版社号',
  `author` varchar(100) DEFAULT NULL COMMENT '作者',
  `translator` varchar(100) DEFAULT NULL COMMENT '译者',
  `stock` int(11) NOT NULL COMMENT '库存',
  `publishDate` varchar(10) DEFAULT NULL COMMENT '出版日期',
  `recordDate` varchar(10) NOT NULL COMMENT '登记日期',
  `lastDate` varchar(10) DEFAULT NULL COMMENT '最后借出日期',
  `price` decimal(10,2) DEFAULT NULL COMMENT '书籍价格 ',
  `pageNum` int(5) NOT NULL COMMENT '页码',
  `borrowTimes` int(5) DEFAULT '0' COMMENT '借阅次数',
  `borrowDays` varchar(20) DEFAULT NULL COMMENT '借书期限  无期限  3天  7天  半个月  一个月  三个月  半年  一年',
  `userid` int(11) DEFAULT NULL COMMENT '借书人工号 ',
  `booksdesc` varchar(500) DEFAULT NULL COMMENT '内容简介',
  `catalog` varchar(500) DEFAULT NULL COMMENT '摘要、目录',
  `status` tinyint(2) DEFAULT '0' COMMENT '借阅状态  0:未借出   1：已借出',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2943 DEFAULT CHARSET=utf8mb4;

